script: |
  super -f text -I q5332.spq | sort > q5332.out

inputs:
  - name: q5332.spq
    data: |
      SELECT + col1 * - col1 AS col2 FROM tab1 (FORMAT parquet) WHERE ( NOT + col0 + - + col2 * - + col2 = + col0 );
  - name: tab1

outputs:
  - name: q5332.out
    data: |
      -196
      -2209
      -25
